import time
a = time.time()

import numpy
def count(chessBoard):
	n = len(chessBoard) # chessBoard = n * n
	res = {x: 0 for x in range(2, n + 1)}
	chessBoard = numpy.array(chessBoard)
	for i in range(n - 1):
		for j in range(n - 1):
			if chessBoard[i][j]:
				for k in range(2, n - max(i, j) + 1):
					if 0 in chessBoard[i: i + k, j: j + k]:
						break
					res[k] += 1
	return {k: v for k, v in res.items() if v}


